<?php
$handle = fopen("C:\\wamp\\www\\everloveframeworkV2\\websites_new\\capture.txt", "w");

$str = "";

$str = chunk_split($str, 6, ",\n");

$strLines = explode(",\n", $str);

$str = "";

foreach ($strLines as $stringLine) {
	$stringLine = chunk_split($stringLine, 4, ",");
	$strLines1 = explode(",", $stringLine);
	
	$str .= hexdec($strLines1[0]) . "," . hexdec($strLines1[1]) . ",\n";
}

fwrite($handle, $str);

fclose($handle);